import Footer from "../../components/footer/Footer";
import Navbar from "../../components/navbar/Navbar";
import "./foodInfo.scss";

const FoodInfo = () => {
    return (
        <div className="home">
            <Navbar />
            <Footer />
        </div>
    );
};

export default FoodInfo;
